import { View, Text, Button, FlatList, container } from "react-native";
import React, { useEffect } from "react";
import { NavigationContainer } from "@react-navigation/native";
// import SelectDropdown from "react-native-material-dropdown";
import axios from "axios";

const Home = () => {
    console.log("in home");
    const fetchData = () => {
        console.log("in home----------------------------");
        const baseURL = "https://localhost:7162/api/Elevators";
        axios
            .get(`${baseURL}`)
            .then((response) => {
                console.log("in home8888888888888888888");
                console.log(response.data);
            })
            .catch((err) => console.log("we have an error:", err));
    };

    useEffect(() => {
        fetchData();
    }, []);
    // const getMoviesFromApi = () => {
    //     return fetch("https://reactnative.dev/movies.json")
    //         .then((response) => response.json())
    //         .then((json) => {
    //             return json.movies;
    //         })
    //         .catch((error) => {
    //             console.error(error);
    //         });
    // };
    return (
        <div>
            <h1>{fetchData}</h1>
            <select value={fetchData} onChange></select>
            <View style={{ container, backgroundColor: "red", height: "100%", width: "100%" }}>
                {/* <getMoviesFromApi /> */}
                <FlatList data={[fetchData]} />
            </View>
        </div>
    );
};

export default Home;
